// 2da pagina creada:
// Misma estructura que "Cursos.tsx"
import React from 'react'
import { IonContent, IonHeader, IonTitle, IonToolbar } from '@ionic/react'

const Objetivos: React.FC = () => {
  return (
    <React.Fragment>
      <IonHeader>
        <IonToolbar>
          <IonTitle>OBJETIVOS</IonTitle>
        </IonToolbar>

        <IonContent>
          <h2>Pagina de Objetivos</h2>
        </IonContent>
      </IonHeader>
    </React.Fragment>
  )
}

export default Objetivos
